import React, { Component } from 'react';
import ReactBootstrap, {Container, Row, Col, FormGroup} from 'react-bootstrap'; 


class SuggestionBox extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			suggested_items: [],
		}		
	}

	static getDerivedStateFromProps(props) {
		console.log('Get derived state from props');
		console.log(props);
		return null;
	}


	render() {		
		console.log('Render Method');
	    return (
			<div className='suggest-box-wrapper'>
				<ul className='ls-none'>
					{this.state.suggested_items}
				</ul>
			</div>
	    )
	}

	componentDidMount() {
		console.log('Component Did Mount');
	}

	shouldComponentUpdate(nextProps) { // ?		
		console.log('Should Component Update');
		const next_props = this.props.suggestions !== nextProps;		
		this.state.suggested_items.push(<li tabIndex=''>{this.props.suggestions}</li>);
		return next_props;
	}
}

export default SuggestionBox;
